import React from 'react';
import './Header.css'
import './Form.css'

function Form(): any {
    return (
        <div className="FormWrapper">
            <label>Nome</label>
            <input type="text" />
            <label>Email</label>
            <input type="email" />
            <label>WhatsApp</label>
            <input type="number" name="whats" id="whats_id" />
        </div>
    )
}

export default Form;
